T~L~-1155~170~0~#0000FF~~9pt~~~~comment~Probe input

1m - probe resistor divider circuit {
    1m = [R1 = 180k, R2 = 820k]
    At the junction of R1 and R2 we get
    a scaled signal ([-3.3v to 3.3v] to [-2.7v, 2.7v])
}

AC coupling {
    an optional 100nF capacitor can be switched in series into the circuit
    with a 10Meg DC bias resistor about GND
}

OP AMP and voltage divider {
    This scaled voltage is fed into our op amp which buffers the signal
    after the amp a gain of 0.6111111111 is applied to the signal
    as well as a positive 1.65v translation. Thus for the output of
    [-2.7 to 2.7] it maps to [0v to 3.3v]~1~start~gge55085~0~pinpart
